def plot_accuracy(accuracies, name="accuracy"):
    fig, ax = plt.subplots()

    ax.plot(range(1, len(accuracies) + 1), accuracies, marker='o')
    # ax.set_title('Accuracy over rounds')
    ax.set_xlabel('Round')
    ax.set_ylabel('Accuracy (%)')
    ax.set_xticks(range(1, len(accuracies) + 1))
    ax.grid(True)

    plt.savefig(f"{name}.pdf", format="pdf", bbox_inches="tight")
    plt.tight_layout()
    plt.show()


def plot_loss(avg_losses, name="loss"):
    fig, ax = plt.subplots()

    ax.plot(range(1, len(avg_losses) + 1), avg_losses, marker='o', color='red')
    # ax.set_title('Average Loss over rounds')
    ax.set_xlabel('Round')
    ax.set_ylabel('Average Loss')
    ax.set_xticks(range(1, len(avg_losses) + 1))
    ax.grid(True)
    plt.savefig(f"{name}.pdf", format="pdf", bbox_inches="tight")
    plt.tight_layout()
    plt.show()


def plot_tpr_fpr(validated, name="tpr_fpr"):
    TPR = validated[0]/(validated[0]+validated[3])
    FPR = validated[1]/(validated[1]+validated[2])

    fig, ax = plt.subplots()

    print("Total positive ", validated[0] + validated[3])
    print("Total positive ", validated[1] + validated[2])
    print("FPR", FPR)
    print("TPR", TPR)
    ax.plot(FPR, TPR, color='red')
    plt.plot([0, 1], [0, 1], '--')
    plt.axis([0, 1, 0, 1])
    ax.set_xlabel('FPR')
    ax.set_ylabel('TPR')

    ax.grid(True)
    plt.savefig(f"{name}.pdf", format="pdf", bbox_inches="tight")
    plt.tight_layout()
    plt.show()


